import numpy as np
import pandas as pd

N = 20
ts = pd.Series(
    np.arange(N),
    index=pd.period_range(start='2010', freq='A', periods=N, name='Year'),
    dtype=pd.Int8Dtype
)

# Lag features
X = pd.DataFrame({
    'y_lag_2': ts.shift(2),
    'y_lag_3': ts.shift(3),
    'y_lag_4': ts.shift(4),
    'y_lag_5': ts.shift(5),
    'y_lag_6': ts.shift(6)
})

# Multi-step targets
y = pd.DataFrame({
    'y_step_3': ts.shift(-2),
    'y_step_2': ts.shift(-1),
    'y_step_1': ts
})

data = pd.concat({'Targets': y, 'Features': X}, axis=1)

data.head(10)
data.style.set_properties(['Targets'], **{'background-color': 'LavenderBlush'})
data.style.set_properties(['Features'], **{'background-color': 'Lavender'})

